import React from 'react';

const DUMMY_EVENTS = [
  {
    id: 'e1',
    title: 'Some event'
  },
  {
    id: 'e2',
    title: 'Another event'
  },
];

const EventsPage = () => {
  return <>
  <h1>EventsPage</h1>
  {DUMMY_EVENTS.map()}
  </>;
};

export default EventsPage;
